import React from "react";
import NavBar from "./NavBar";
import Header from "./Header";
import { DUMMY_CITY } from "./homapage";
import { Card, CardBody, CardImg, CardTitle, CardText } from "reactstrap";

const Home = () => {
  // console.log(DUMMY_CITY[0].image);
  return (
    <div>
      <NavBar />
      <Header />
      {DUMMY_CITY.map((city) => {
        <Card>
          <CardImg src={city.image} width="100%" />
          <CardBody>
            <CardTitle>{city.name}</CardTitle>
            <CardText>{city.subText}</CardText>
          </CardBody>
        </Card>;
      })}
    </div>
  );
};

export default Home;
